import React, { useEffect, useState, useCallback } from 'react'
import { Header } from './Header'
import { SummaryCard } from './SummaryCard'
import { IncomeChart } from './IncomeChart'
import {
  Wallet,
  DollarSign,
  ClipboardCheck,
  CreditCard,
  FileText,
  BarChart2,
} from 'lucide-react'

export const Dashboard = () => {
  const [pendingInspectionCount, setPendingInspectionCount] = useState(0)
  const [loadingPending, setLoadingPending] = useState(false)
  const [errorPending, setErrorPending] = useState(null)

  // Mock navigation function (replace with router navigation in future)
  const handleCardClick = (destination) => {
    console.log(`Navigating to ${destination}`)
  }

  // Load pending inspection estimation requests count
  const loadPendingInspections = useCallback(async () => {
    setLoadingPending(true)
    setErrorPending(null)
    let debug = { stage: 'start' }
    try {
      const res = await fetch('/api/inspection-estimation/pending')
      debug.status = res.status
      debug.ok = res.ok
      if (!res.ok) {
        throw new Error(`HTTP ${res.status}`)
      }
      const data = await res.json()
      debug.dataType = Array.isArray(data) ? 'array' : typeof data
      debug.raw = data
      if (Array.isArray(data)) {
        setPendingInspectionCount(data.length)
      } else if (data && Array.isArray(data.results)) {
        setPendingInspectionCount(data.results.length)
      } else if (data && Array.isArray(data.items)) {
        setPendingInspectionCount(data.items.length)
      } else {
        setPendingInspectionCount(0)
        setErrorPending('Unexpected response shape')
      }
    } catch (e) {
      setPendingInspectionCount(0)
      setErrorPending(e.message || 'Failed to load')
      debug.error = e.message
    } finally {
      setLoadingPending(false)
      debug.finalCount = pendingInspectionCount
      // eslint-disable-next-line no-console
      console.debug('[PendingInspectionDebug]', debug)
    }
  }, [pendingInspectionCount])

  useEffect(() => {
    loadPendingInspections()
  }, [loadPendingInspections])

  // Auto refresh every 60s (cleared on unmount)
  useEffect(() => {
    const id = setInterval(() => {
      loadPendingInspections()
    }, 60000)
    return () => clearInterval(id)
  }, [loadPendingInspections])

  return (
    <div className="p-6 max-w-7xl mx-auto">
      <Header title="Dashboard" />

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 mt-6">
        <SummaryCard
          title="Total Balance"
          value="632,000"
          icon={
            <div className="w-10 h-10 rounded-full bg-orange-100 flex items-center justify-center text-orange-500">
              <Wallet size={20} />
            </div>
          }
          change="+1.29%"
          changeType="positive"
          onClick={() => handleCardClick('balance')}
        />

        <SummaryCard
          title="Total Income"
          value="632,000"
          icon={
            <div className="w-10 h-10 rounded-full bg-blue-100 flex items-center justify-center text-blue-500">
              <DollarSign size={20} />
            </div>
          }
          change="+1.29%"
          changeType="positive"
          onClick={() => handleCardClick('income')}
        />

        <SummaryCard
          title="Inspection Estimate Generations Pendings"
            /* Show loading as ellipsis, else count */
          count={loadingPending ? 'â€¦' : pendingInspectionCount}
          loading={loadingPending}
          error={errorPending}
          onRefresh={loadPendingInspections}
          icon={
            <div className="w-10 h-10 rounded-full bg-green-100 flex items-center justify-center text-green-500">
              <ClipboardCheck size={20} />
            </div>
          }
          onClick={() => handleCardClick('inspection-estimates')}
        />

        <SummaryCard
          title="Payment Approval Pendings"
          count={3}
          icon={
            <div className="w-10 h-10 rounded-full bg-green-100 flex items-center justify-center text-green-500">
              <CreditCard size={20} />
            </div>
          }
          onClick={() => handleCardClick('payment-approvals')}
        />

        <SummaryCard
          title="Quotation Generations Pendings"
          count={3}
          icon={
            <div className="w-10 h-10 rounded-full bg-red-100 flex items-center justify-center text-red-500">
              <FileText size={20} />
            </div>
          }
          onClick={() => handleCardClick('quotations')}
        />

        <SummaryCard
          title="Extra"
          count={5}
          icon={
            <div className="w-10 h-10 rounded-full bg-red-100 flex items-center justify-center text-red-500">
              <BarChart2 size={20} />
            </div>
          }
          onClick={() => handleCardClick('extra')}
        />
      </div>

      <IncomeChart />
    </div>
  )
}
